function rightSidebarJSON(e){$("#rightSidebar .title .label").append(e.title),$("#rightSidebar .title .count").append(" ("+e.items.length+")"),$(e.items).each(function(){$('<li><a href="#">'+this.header+"</a></li>").appendTo("#rightSidebar .content ol")})}function getRightSidebarData(e){$.ajax({dataType:"json",url:e+"/src/json/rightSidebar.min.json",success:rightSidebarJSON,error:function(){console.log("No right sidebar JSON found.")},complete:function(){console.log("Right sidebar JSON loaded.")}})}